function GetHomework() {
	let previosDate = '-';
	for (let keyDate in chHomework) { // –æ—Ç—Ä–∏–º—É—î–º–æ –¥–∞—Ç—É –≤–∏–¥–∞—á—ñ –∑–∞–≤–¥–∞–Ω–Ω—è
		for (let keyLesson in chHomework[keyDate]) { // –æ—Ç—Ä–∏–º—É—î–º–æ –Ω–∞–∑–≤—É —É—Ä–æ–∫—É

			// –û—Ç—Ä–∏–º—É—î–º–æ –Ω–æ–º–µ—Ä –¥–∞—Ç–∏ –ø–æ–ø–µ—Ä–µ–¥–Ω—å–æ–≥–æ —É—Ä–æ–∫—É
			let previosI = chLessonDate[keyLesson].chDate.count;
			// –Ü–Ω–∫—Ä–µ–º–µ–Ω—Ç –Ω–æ–º–µ—Ä—É –¥–∞—Ç–∏ —É—Ä–æ–∫—É
			chLessonDate[keyLesson].chDate.count++;
			// –û—Ç—Ä–∏–º—É—î–º–æ –Ω–æ–º–µ—Ä –¥–∞—Ç–∏ —Ü—å–æ–≥–æ —É—Ä–æ–∫—É 
			let nowI = chLessonDate[keyLesson].chDate.count;

			// –ü—Ä–∏—Å–≤–æ—é—î–º–æ –Ω–æ–º–µ—Ä - –¥–∞—Ç—ñ —Ü—å–æ–≥–æ —É—Ä–æ–∫—É 
			chLessonDate[keyLesson].arI[nowI] = keyDate;

			// –û—Ç—Ä–∏–º—É—î–º–æ –¥–∞—Ç—É –ø–æ–ø–µ—Ä–¥–Ω—å–æ–≥–æ —É—Ä–æ–∫—É  
			previosDate = '-';
			if (previosI > 0) {
				previosDate = chLessonDate[keyLesson].arI[previosI];
			}
			// –ü—Ä–∏—Å–≤–æ—é—î–º–æ –¥–∞—Ç—ñ —É—Ä–æ–∫—É - –ø–æ–ø–µ—Ä–µ–¥–Ω—é –¥–∞—Ç—É —Ü—å–æ–≥–æ —É—Ä–æ–∫—É
			chLessonDate[keyLesson].chDate[keyDate] = previosDate;
		}
	}
}

